import React from "react";

function ImageComponent() {
  return (
    <div className="image-component">
      <img
        src="path-to-your-image.jpg" // Replace with the actual image path
        alt="Sample Image"
        className="image"
      />
    </div>
  );
}

export default ImageComponent;
